import React, {Component} from 'react';
import StudentId from './StudentId';

class StudentList extends Component {
    state = {
        studentData : [{
            id: 1, 
            firstName : "vishal",
            lastName : "sharma",
            dob : "14/03/1997",
            collageName: "srcem",
            address: "japan",
            isShow: true,
            image : "data:image/jpeg;base64,"
        },{
            id: 2, 
            firstName : "soumya",
            lastName : "agarwal",
            dob : "14/03/1997",
            collageName: "srcem",
            address: "japan",
            isShow: true,
            image: "data:image/jpeg;base64,"
        }, {
            id: 3, 
            firstName : "kavi",
            lastName : "rajput",
            dob : "14/03/1997",
            collageName: "srcem",
            address: "japan",
            isShow: true,
            image : "data:image/jpeg;base64,"
        }]
    }

    removeStudent = (i) => {
        let {studentData} = this.state;

        this.setState({
            studentData : studentData.filter((student,index)=> {
                return index !== i;
            })
        })
    }

    showAndHideCollageDetails = (i) => {
        console.log(i);
        let {studentData} = this.state;
        studentData[i].isShow = !studentData[i].isShow;
        this.setState({
            studentData
        })
    }
    

    render(){

        const {studentData} = this.state;

        return(
            <>
            <StudentId studentData = {studentData} removeStudent = {this.removeStudent} showAndHideCollageDetails = {this.showAndHideCollageDetails} />
            </>
        )
    }
}


export default StudentList;